import React from 'react'

function Header() {
    let title = "";
    const client = "Programmer";

    if (client === "Desinger") {
        title = "Design is my life"
    } else {
        title = "Programming is my life"
    }

    return (
        <div className='navbar bg-dark rounded'>
            <h1 className="text-white">{client === "Desinger"}</h1>
        </div>


    );
}
export default Header
